import React from 'react';
import '../style/Scoreboard.css'

function Scoreboard() {
    return (
        <div class="container-fluid">
            <div class="block">
                <br />
                <h1><b>Academic Team Score Keeper</b></h1>
                <h3>Use this platform to help keep track of scores during scrimmages.</h3>
                <br />
            </div>
            <br />
        <br />
        </div>    
    );
}

export default Scoreboard;
